INF = 1 << 31
class Solution(object):
	def maxProduct(self, nums):
		"""
		:type nums: List[int]
		:rtype: int
		"""
		n = len(nums)
		ans = -INF
		idx0 = 0
		for i in xrange(n):
			if nums[i] == 0:
				ans = max(ans, 0)
				ans = max(ans, self.f(nums[idx0: i]))
				idx0 = i + 1
		ans = max(ans, self.f(nums[idx0: n]))
		if ans == -INF:
			ans = self.f(nums)
		return ans

	def f(self, nums):
		n = len(nums)
		if n == 0:
			return -INF
		p = [0] * n
		p[0] = nums[0]
		for i in xrange(1, n): p[i] = p[i - 1] * nums[i]
		f = INF
		s = -INF
		c = 0
		for i in xrange(0, n):
			if nums[i] < 0:
				c += 1
				f = min(f, i)
				s = max(s, i)
		if c % 2 == 0:
			return p[n - 1]
		if f == n - 1:
			return p[s - 1]
		if s == 0:
			return p[n - 1] / p[f]
		return max(p[n - 1] / p[f], p[s - 1])


